export default function isFiltered(state = false, action) {
	console.log(state);
	switch (action.type) {
		case 'IS_FILTERED_PLAYLISTS':
			console.log(action.isFiltered);
			console.log(state);
			return action.isFiltered;
		default:
			return state;
	}
}
